        private static void Registration()
        {
            //Stream Server Packets
            Register(0x01, new OnPacketReceive<StreamConnection>(Handle_CTJoin_0x01));
            Register(0x02, new OnPacketReceive<StreamConnection>(Handle_NoPacket_0x02));
            Register(0x05, new OnPacketReceive<StreamConnection>(Handle_CTContinue_0x05));
