        #region Game Server Delegates
        private static void Handle_CTJoin_0x01(StreamConnection net, PacketReader reader)
        {
            //получили CTJoin_0x0001
            short id = reader.ReadLEInt16();
            long AccountID = reader.ReadLEInt64();
            int cookie = reader.ReadLEInt32();

            byte success = 0; //GameServerController.RegisterGameServer(id, password, net, port, ip);
            //отправляем на него TCJoinResponse_0x01
            net.SendAsync(new NET_TCJoinResponse_0x01(success));
            m_idx = 100;  //0 - разрешаем пакеты. Временно отключаем
            m_end1 = true; //false - разрешаем пакеты. Временно запретим
            m_end2 = true; //false - разрешаем пакеты. Временно запретим
        }
        private static void Handle_NoPacket_0x02(StreamConnection net, PacketReader reader)
        {
            //получили NoPacket_0x02
            if (m_idx == 0)
            {
                if (!m_end1)
                {
                    m_id = 0;
                    m_next = 30;
                    m_count = 30;
                    //первый пакет NET_TCDoodadStream_0x02(msg), следом будут в ответ на Handle_CTContinue_0x05
                    //92030200000000001E0000001E000000
                    string msg = "";
                    net.SendAsync(new NET_TCDoodadStream_0x02(m_id, m_next, m_count, msg));
                    m_end1 = true; // больше не вызывать
                }
            }
            m_idx += 1;
        }
